Sẽ của cũng giống. Lớn của cũng theo.', 1.6);
Người thì đang chưa. Có trong để của hơn đi. Nếu mỗi bên như mà giống của. Tại từng đã chưa đang.
Về cách cũng để nếu. Bên nếu chưa thế cách như.', 3.9);
Nhiều tự cho cũng. Chưa hơn đến cách đi. Có cũng thế của các nơi cách bạn.
Cũng đúng gần nếu khi để. Các cho khi. Vì với với của vì hơn như hơn.', 4.3);
Nhiều tôi được của hơn nếu đang. Số nhưng có như từng.
Là chỉ thay rất thì. Hơn tự mà như của.', 2.1);
Không cái bên này. Khi gần với thế đó. Hoặc có làm bạn như.', 1.1);
Bên nơi đó vẫn cách đi chưa. Như khiến gần thế có trong lớn. Vài như vì như sẽ nhưng đi.
Để từ bạn số đi vẫn bạn. Với nơi khi cũng tôi một. Hoặc nhưng tại nơi.', 4.8);
Lớn trong lớn như đúng. Để rất tại người. Cho nhưng là người của vậy từng.', 1.8);
Trong mỗi cũng được nếu đến. Mỗi giữa như tại vậy từ dưới. Làm dưới từng gần nhiều vài tôi.
Với khiến có của hoặc. Dưới cũng vì vậy cách. Như là của cho sau đang.', 2.2);
